css:
@-moz-document domain(gobyexample.com) {
    body {
        background-color: #222 !important;
        background-image: url(data:image/png;base64,)!important;
        background-clip: border-box !important;
        background-origin: padding-box !important;
        background-attachment: scroll !important;
        background-repeat: repeat !important;
        background-size: auto !important;
        background-position: left top !important;
        color: #e2e2e2 !important
    }
    
    a {
        color: #e2e2e2 !important;
        font-weight: bold;
    }
    
    .code {
        background-color: rgb(39, 40, 34) !important;
    }
    
    /* magenta */
    .code .kd, .code .kn, .code .k, .code .o {
        color: rgb(249, 38, 114) !important;
    }
    
    /* violet */
    .code .kc, .code .mi, .code .mf {
        color: rgb(174, 129, 255) !important;
    }
    
    /* light blue */
    .code .kt, .code .nb {
        color: rgb(102, 217, 239) !important;
    }
    
    /* white */
    .code .nx, .code .gp {
        color: rgb(255, 255, 255) !important;
    }
    
    /* yellow */
    .code .s {
        color: rgb(230, 219, 116) !important;
    }
}
